import React from 'react';
import { Link } from 'react-router-dom';

const GameContainer = ({ games }) => {
  return (
    <div>
      {games.map((game) => (
        <div key={game.id}>
          <Link to={`/games/${game.id}`}>
            <h3>{game.name}</h3>
          </Link>
        </div>
      ))}
    </div>
  );
};

export default GameContainer;
